import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Header from "./components/Header";
import Footer from "./components/Footer";
import DynamicPage from "./components/DynamicPage"; // import it

import "./App.css";

function App() {
  return (
    <Router>
      <Header />

      <main className="content">
        <Routes>
          <Route path="/" element={<DynamicPage pageName="home" />} />
          <Route path="/about" element={<DynamicPage pageName="about" />} />
          <Route path="/services" element={<DynamicPage pageName="services" />} />
          <Route path="/contact" element={<DynamicPage pageName="contact" />} />
        </Routes>
      </main>

      <Footer />
    </Router>
  );
}

export default App;
